                        жизни, находят новых воспитанников в гаданиях. О своих жертвах сёстры узнают в медитации и
                        пророческих изречениях. Они не принимают контрактов, и, похоже, не преследуют жертв из-за
                        политики или кор");
            WriteLiteral(@"ысти. Их убийства не выглядят частью какого-то замысла, и могут показаться
                        не связанными между собой: сегодня жертвой станет человек с великой властью, завтра —
                        крестьянин или копатель колодцев. Какой бы между убийствами ни было связи, её знают лишь
                        сёстры. Они считают убитых жертвенным даром, а смерть от рук ордена — большой честью. Не
                        ведающие своей личности, взращённые лишь на устоях ордена, убийцы легко заменяют друг друга,
                        и число их неведомо. Возможно, их много; возможно, их единицы. Что лежит под вуалью — тайна
                        без ответа. И лишь изредка эта сестра, когда никто не слышит, поднимает свою вуаль, чтобы
                        нарушить запрет, прошептав своё имя: Мортред.</p>
